import React from "react";
import {Link} from "react-router-dom";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

import withContext from "../withContext";

const HomePage = props => {

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    arrows: false,
    slidesToShow: 1,
    slidesToScroll: 1,
    lazyload: 'progressive',
    autoplay: true,
    autoplayspeed: 5000
  };

  const slides = [
      {
          id : 0, info : "test0", path : "/images/image1.jpg"
      },
      {
          id : 1, info : "test1", path : "/images/image2.jpg"
      },
      {
          id : 2, info : "test2", path : "/images/image3.jpg"
      },
      {
          id : 3, info : "test3", path : "/images/image4.jpg"
      },
      {
          id : 4, info : "test4", path : "/images/image5.jpg"
      },
      {
          id : 5, info : "test5", path : "/images/image6.jpg"
      },
      {
          id : 6, info : "test6", path : "/images/JAMPRO.jpeg"
      },
  ];

  return (
    <>
      <div className="hero">
        <div className="columns">
          <div className="column is-two-third" style={{padding:"0",minHeight:"0",minWidth:"0"}}> 
              <div className="slick-wrapper">
                <Slider {...settings}>
                  {slides.map((slide) => 
                      <div key={slide.id}>
                          <img className="slick-slide-image customSlide" 
                            name={slide.id} alt={slide.id} src={slide.path}>
                          </img>
                      </div>
                  )}
                </Slider>
              </div>
          </div>
          <div className="column is-one-third">
              <b>Latest Information</b>
              <br />
              <Link to="/postings"> <button>Information Bulletin</button> </Link>
          </div>
        </div> 
        <div className="hero">
          <div className="container">
            <div class="card">
              <div className="card-image">
                <figure className="image is-4by3">
                  <img src="https://bulma.io/images/placeholders/1280x960.png" alt="Placeholder" />
                </figure>
              </div>
              <div className="card-content">
                <div className="content">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                  Phasellus nec iaculis mauris. <a>@bulmaio</a>.
                  <a href="#">#css</a> <a href="#">#responsive</a>
                  <br />
                  <time datetime="2016-1-1">11:09 PM - 1 Jan 2016</time>
                </div>
              </div>
          </div>
          </div>
        </div>
        <br />
        HomePage

      </div>
    </>
  );
};

export default withContext(HomePage);
